import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div>
      <ul>
        <li> <Link to={"/"}>Home</Link> </li>
        <li link="about">About</li>
        <li>Contact</li>
      </ul>
    </div>
  );
};

export default Header;
